import React from "react"
import { Route, Routes } from "react-router-dom";
import Register from "./Pages/Auth/Register";
import Login from "./Pages/Auth/Login";



function App() {
  return (
    <>
    <Routes>
      <Route path="/" element= {<Register/>} />
      <Route path="/login" element= {<Login/>} />
      ,
    </Routes>
    </>
  );
}

export default App;
